import React, { Component } from 'react'

class People extends Component {
    render() {
        return (
            < React.Fragment >
                {
                    this.props.datos.map(persona => {
                        <div className="card">
                            <img src="..." class="card-img-top" alt="..." />
                            <div class="card-body">
                                <h5 class="card-title">{persona.name}</h5>
                                <p class="card-text"><span> </span>{persona.surname}</p>
                                <p class="card-text"><span>Gender: </span>{persona.gender}</p>
                                <p class="card-text"><span>Region: </span>{persona.region}</p>

                            </div>
                        </div>
                    })
                }
            </React.Fragment >
        )
    }
}

export default People
